import React, { useState } from 'react';
import PatternLearningFeedback from './PatternLearningFeedback';
import EndpointTester from './EndpointTester';

function App() {
  const [tab, setTab] = useState('tester');
  const [serverUrl, setServerUrl] = useState('http://localhost:8000');
  const [caseId, setCaseId] = useState('54820');

  return (
    <div style={{ maxWidth: 1100, margin: '40px auto', padding: 24, background: '#fff', borderRadius: 12, boxShadow: '0 2px 12px #0001' }}>
      <div style={{ display: 'flex', justifyContent: 'center', marginBottom: 24 }}>
        <button
          onClick={() => setTab('tester')}
          style={{
            padding: '10px 32px',
            marginRight: 16,
            background: tab === 'tester' ? '#6c47ff' : '#eee',
            color: tab === 'tester' ? '#fff' : '#333',
            border: 'none',
            borderRadius: 6,
            fontWeight: 'bold',
            cursor: 'pointer'
          }}
        >
          ðŸš€ Endpoint Tester
        </button>
        <button
          onClick={() => setTab('pattern')}
          style={{
            padding: '10px 32px',
            background: tab === 'pattern' ? '#6c47ff' : '#eee',
            color: tab === 'pattern' ? '#fff' : '#333',
            border: 'none',
            borderRadius: 6,
            fontWeight: 'bold',
            cursor: 'pointer'
          }}
        >
          ðŸ§  Pattern Learning Dashboard
        </button>
      </div>
      {tab === 'tester' && (
        <EndpointTester />
      )}
      {tab === 'pattern' && (
        <div>
          <div style={{ display: 'flex', gap: 16, marginBottom: 24 }}>
            <div>
              <label>Server URL:</label>
              <input
                type="text"
                value={serverUrl}
                onChange={e => setServerUrl(e.target.value)}
                style={{ marginLeft: 8, width: 250 }}
              />
            </div>
            <div>
              <label>Case ID:</label>
              <input
                type="text"
                value={caseId}
                onChange={e => setCaseId(e.target.value)}
                style={{ marginLeft: 8, width: 120 }}
              />
            </div>
          </div>
          <PatternLearningFeedback serverUrl={serverUrl} caseId={caseId} />
        </div>
      )}
    </div>
  );
}

export default App;
